  return (
    <div id='outer div element'>
    <button type="button">Create New Post</button>
    {
      posts.map((post) => {
        const {description, location, price, title, willDeliver, _id} = post;
        return (
          <div key={_id}>
            <h3>{title}</h3>
            <p>Description: {description}</p>
            <p>Price: {price}</p>
            <p>Location: {location}</p>
            <p>Delivery: {willDeliver}</p>
          </div>
        )
      })
    }
  </div>
  )
}

export default Posts;
